import React, { Fragment } from "react";
import mealsImage from "./../../images/meals.jpg";

const Header = (props) => {
  return (
    <Fragment>
      <h1>ReactMeals</h1>
      <button> Cart</button>
      <image src={mealsImage}></image>
    </Fragment>
  );
};

export default Header;
